// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.7.0;
pragma experimental ABIEncoderV2;

contract SerugoMedico {
    mapping(address => bool) public adminMapping;

    constructor() public {
        adminMapping[msg.sender] = true;
    }

    modifier onlyAdmin() {
        require(adminMapping[msg.sender], "Not an Admin");
        _;
    }

    modifier onlyDoctor() {
        require(isADoctor[msg.sender], "Not a Doctor");
        _;
    }

    modifier onlyAssignedDoctor(uint256 _id) {
        require(isADoctor[msg.sender], "Not a Doctor");
        require(
            patientMapping[_id].assignedDoctors[msg.sender],
            "You are not assigned to this patient"
        );
        _;
    }

    uint256 doctorMappingCount;
    uint256 public patientMappingCount;
    uint256 public publicRecordsMappingCount;

    mapping(uint256 => Patient) public patientMapping;
    mapping(address => Patient) patientAddressMapping;
    mapping(uint256 => Doctor) doctorMapping;
    mapping(address => bool) isADoctor;
    mapping(uint256 => publicMedicalRecord) public publicRecordsMapping;

    struct Patient {
        uint256 id;
        string name;
        uint256 phoneNo;
        string email;
        address patientAddress;
        uint256 donatedFunds;
        mapping(address => bool) assignedDoctors;
        mapping(uint256 => MedicalRecord) medicalRecordMapping;
        uint256 medicalRecordMappingCount;
    }

    struct MedicalRecord {
        uint256 id;
        string name;
        string ipfsHash;
        address medicalRecordDoctor;
    }

    struct publicMedicalRecord {
        uint256 id;
        uint256 patientId;
        string name;
        address patientAddressToDonateFunds;
    }

    struct Doctor {
        uint256 id;
        address docAddress;
        string docName;
        string docSpecialisation;
    }

    //adding patient, doctor, assigning doctor onlyAdmin()
    function addNewPatient(
        string memory _name,
        string memory _email,
        uint256 _phoneNo,
        address _address
    ) public onlyAdmin {
        Patient memory _newpatient;
        _newpatient.id = patientMappingCount;
        _newpatient.name = _name;
        _newpatient.email = _email;
        _newpatient.phoneNo = _phoneNo;
        _newpatient.patientAddress = _address;
        patientMapping[patientMappingCount] = _newpatient;
        patientAddressMapping[_address] = _newpatient;
        patientMappingCount++;
    }

    function addNewDoctor(
        string memory _docName,
        address _docAddress,
        string memory _docSpecialisation
    ) public onlyAdmin {
        Doctor memory _newDoctor;
        _newDoctor.id = doctorMappingCount;
        _newDoctor.docAddress = _docAddress;
        _newDoctor.docName = _docName;
        _newDoctor.docSpecialisation = _docSpecialisation;
        doctorMapping[doctorMappingCount] = _newDoctor;
        isADoctor[_docAddress] = true;
        doctorMappingCount++;
    }

    function assignDoctor(
        address _docAddress,
        uint256 _patientId,
        address _address
    ) public onlyAdmin {
        require(isADoctor[_docAddress], "Not a doctor address");
        require(
            patientMapping[_patientId].patientAddress == _address,
            "Patient ID and ADDRESS do not match"
        );
        patientMapping[_patientId].assignedDoctors[_docAddress] = true;
        patientAddressMapping[_address].assignedDoctors[_docAddress] = true;
    }

    //adding new MedicalRecord to diseaseMapping and abstract disease to diseasePublic
    function addMedicalRecord(
        uint256 _id,
        string memory _name,
        string memory _ipfsHash
    ) public onlyAssignedDoctor(_id) {
        MedicalRecord memory _medicalRecord;
        publicMedicalRecord memory _publicMedicalRecord;

        address _patientAddress = patientMapping[_id].patientAddress;

        _medicalRecord.id = patientMapping[_id].medicalRecordMappingCount;
        _medicalRecord.name = _name;
        _medicalRecord.ipfsHash = _ipfsHash;
        _medicalRecord.medicalRecordDoctor = msg.sender;
        patientMapping[_id].medicalRecordMapping[patientMapping[_id]
            .medicalRecordMappingCount] = _medicalRecord;
        patientAddressMapping[_patientAddress]
            .medicalRecordMapping[patientAddressMapping[_patientAddress]
            .medicalRecordMappingCount] = _medicalRecord;
        patientMapping[_id].medicalRecordMappingCount++;

        _publicMedicalRecord.id = publicRecordsMappingCount;
        _publicMedicalRecord.patientId = _id;
        _publicMedicalRecord.name = _name;
        _publicMedicalRecord.patientAddressToDonateFunds = _patientAddress;

        publicRecordsMapping[publicRecordsMappingCount] = _publicMedicalRecord;
        publicRecordsMappingCount++;
    }

    function retrieveMedicalRecord(uint256 _diseaseId, address _patientAddress)
        public
        view
        returns (MedicalRecord memory)
    {
        return
            patientAddressMapping[_patientAddress]
                .medicalRecordMapping[_diseaseId];
    }

    function retrieveMedicalRecordCount(address _address)
        public
        view
        returns (uint256)
    {
        require(msg.sender == _address);
        return patientAddressMapping[_address].medicalRecordMappingCount;
    }

    //add new admin
    function addNewAdmin(address _address) public onlyAdmin {
        require(adminMapping[msg.sender], "Not an Admin");
        adminMapping[_address] = true;
    }

    //donateFunds
    function donateFunds(uint256 _id) public payable {
        patientMapping[_id].donatedFunds += msg.value;
        patientAddressMapping[patientMapping[_id].patientAddress]
            .donatedFunds += msg.value;
    }
}
